const NavBarItems = () =>{
    return(
        <>
        <ul className="navbar-ul">
            <li className="navbar-li Home-background"><a href="#">Home</a></li>
            <li className="navbar-li nav-item-menu"><a href="#">Explore</a></li>
            <li className="navbar-li nav-item-menu" ><a href="#">Stats</a></li>
            <li className="navbar-li nav-item-menu"><a href="#">Create</a></li>
        </ul>
        </>
    )
};
export default NavBarItems;
